svg.script:
window.addEventListener("load", function() {

	var svg = document.getElementById('ws-x4624-sfp-e');
	var tooltip = svg.getElementById('tooltip');
	var tooltipText = tooltip.getElementsByTagName('text')[0];
	var tooltipRects = tooltip.getElementsByTagName('rect');
	var triggers = svg.getElementsByClassName('tooltip-trigger');

    for (var i = 0; i < triggers.length; i++) {
		triggers[i].addEventListener('mousemove', showTooltip);
		triggers[i].addEventListener('mouseout', hideTooltip);
	}

	function showTooltip(evt) {
		var CTM = svg.getScreenCTM();
		var x = (evt.clientX - CTM.e - 20) / CTM.a;
		var y = (evt.clientY - CTM.f - 16) / CTM.d;
		tooltip.setAttributeNS(null, "transform", "translate(" + x + " " + y + ")");
		tooltip.setAttributeNS(null, "visibility", "visible");

		tooltipText.firstChild.data = evt.target.getAttributeNS(null, "data-tooltip-text");
		var length = tooltipText.getComputedTextLength();
		for (var i = 0; i < tooltipRects.length; i++) {
			tooltipRects[i].setAttributeNS(null, "width", length + 8);
		}
	}

	function hideTooltip(evt) {
		tooltip.setAttributeNS(null, "visibility", "hidden");
	}

	var getLocal = JSON.parse(localStorage.getItem('arraysInfoPort'));
    var count = 1;
	var lengthArray = getLocal.length;

	for(var i=0; i<lengthArray; i++){
        while(lengthArray--){
            for(var j=0; j<getLocal[i].length; j++){
                var splitCard = getLocal[i][j].split(/[()]/);
                if (splitCard[0].includes("Linecard") === true){
                    if(count%24 != 0){
                        if(getLocal[i][2] === "up"){
                            var path = document.getElementById("p" + count).style.fill = "green";
                            var path1 = document.getElementById("p" + count).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
                        } else if(getLocal[i][2] === "down"){
                            var path = document.getElementById("p" + count).style.fill = "red";
                            var path1 = document.getElementById("p" + count).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
                        } else if(getLocal[i][2] === "admin_down"){
                            var path = document.getElementById("p" + count).style.fill = "grey";
                            var path1 = document.getElementById("p" + count).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
                        } else {
                            var path = document.getElementById("p" + count).style.fill = "black";
                            var path1 = document.getElementById("p" + count).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
                        }
                        count++;
                        getLocal.splice(0,1);

                    } else {
                        if(getLocal[i][2] === "up"){
                            var path = document.getElementById("p" + count).style.fill = "green";
                            var path1 = document.getElementById("p" + count).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
                        } else if(getLocal[i][2] === "down"){
                            var path = document.getElementById("p" + count).style.fill = "red";
                            var path1 = document.getElementById("p" + count).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
                        }else if(getLocal[i][2] === "admin_down"){
                            var path = document.getElementById("p" + count).style.fill = "grey";
                            var path1 = document.getElementById("p" + count).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
                        } else {
                            var path = document.getElementById("p" + count).style.fill = "black";
                            var path1 = document.getElementById("p" + count).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
                        }
                        count = 1;
                        getLocal.splice(0,1);
                    }
                }
            }
        }
    }

    localStorage.setItem("arraysInfoPort", JSON.stringify(getLocal));

});
